import React from "react";
import { Channel, useChatContext } from "stream-chat-react";
import Cookies from "universal-cookie";

import { ChannelSearch, TeamChannelList, TeamChannelPreview } from "./";

const SideBar = () => {
  <div className="channel-list__sidebar">
    <div className="channel-list__sidebar__icon1">
      <div className="icon1--inner">
        <img
          src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fes.logodownload.org%2Fdiscord-logo%2F&psig=AOvVaw39D4_ZWPZM3asRIb7EyZhA&ust=1650364665770000&source=images&cd=vfe&ved=0CAwQjRxqFwoTCPjt-861nfcCFQAAAAAdAAAAABAD"
          alt="Logo"
          width={30}
        ></img>
      </div>
    </div>
    <div className="channel-list__sidebar__icon2">
      <div className="icon2--inner">
        <img src="" alt="" />
        <ion-icon name="log-out-outline" width="30"></ion-icon>
      </div>
    </div>
  </div>;
};
const ChannelListContainer = () => {
  return <SideBar></SideBar>;
};

export default ChannelListContainer;
